webpackJsonp([39996217590536],{7954:function(t,e){t.exports={data:{post:{html:'<p><a href="http://www.flickr.com/photos/51035717986@N01/1487475653" title="View \'CIMG0261\' on Flickr.com"><img src="http://farm2.static.flickr.com/1222/1487475653_aebc64e911.jpg" alt="CIMG0261" border="0" width="500" height="375" /></a></p>\n<p>The October 3rd holiday was good for the restaurant (it was like an extra weekend in the middle of the week), but it wasn\'t so good for our indoor playland. A child kicked out one of the clear plastic panels, and we had to close it down for the rest of the day.</p>\n<p><a href="http://www.flickr.com/photos/51035717986@N01/1488329212" title="View \'CIMG0262\' on Flickr.com"><img src="http://farm2.static.flickr.com/1146/1488329212_4bfd845225.jpg" alt="CIMG0262" border="0" width="500" height="375" /></a></p>\n<p>We will be getting rid of the playland when we remodel next month (we need the room for more seats), so it\'s not worth the bother to properly repair. As I was leaving yesterday, a carpenter was putting in a round wooden panel so that we could let kids back into the plastic box.</p>',fields:{title:"Broken Window",date:"05 Oct 2007",url:"https://papascott.de/2007-10-05-broken-window/"}}},pathContext:{slug:"/2007-10-05-broken-window/",prev:{fields:{title:"Banner Ad",date:"04 Oct 2007",slug:"/2007-10-04-banner-ad/"}},next:{fields:{title:"20 Cents Per Roll",date:"12 Oct 2007",slug:"/2007-10-12-20-cents-per-roll/"}}}}}});
